import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import AboutMe from './pages/aboutMe';
import Navbar from './components/navbar';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<AboutMe/>} />
          <Route path='/navbar' element={<Navbar/>} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
